import React from 'react';
import './Navbar.css';
import logo from '../../assets/logo.png'

const Navbar = () => {
    return(
        <nav>

            <div className='profile-picture-box'>
                <div> <img src={logo} alt={"logo"}></img></div>
                <p>Jossue Fuentes</p>
            </div>

            <div>
                <ul>
                    <li>Home</li>
                    <li>Articles</li>
                    <li>Portfolio</li>
                    <li>Stack</li>
                </ul>
            </div>
        </nav>
    );
};

export default Navbar;
